import React from "react";
import classes from "./TimerSettings.module.css";
import Options from "./Options";

const TimerSettings = (props) => {
  return (
    <div className={classes.timerSettings}>
      <div className={classes.timerHeading}>Time (minutes)</div>
      <div className={classes.timeTile}>
      <label for="dropdown" className={classes.settingHeading}>Pomodoro:</label>
        <div>
          <select id="dropdown" className={classes.dropDown}>
            <option value="option1">15</option>
            <option value="option2">20</option>
            <option value="option3" selected>25</option>
            <option value="option3">30</option>
            <option value="option3">35</option>
            <option value="option3">40</option>
            <option value="option3">45</option>
            <Options></Options>
          </select>
        </div>
      </div>
    </div>
  );
};

export default TimerSettings;
